p to 5 visible lines for energy plots (plot4, plot5, plot6)\n        var energyPlots = [plot4, plot5, plot6];\n        var energyValues = collectAllVisibleValues(energyPlots);\n\n        // Calculate new x and y ranges for energy plots based on the visible data\n        var x_range_energy = calculateRangeWithBuffer(energyValues.x);\n        var y_range_energy = calculateRangeWithBuffer(energyValues.y);\n\n        // Apply the new ranges to energy plots (plot4, plot5, plot6)\n        energyPlots.forEach(function(plot) {\n            plot.x_range.start = x_range_energy.start;\n            plot.x_range.end = x_range_energy.end;\n            plot.y_range.start = y_range_energy.start;\n            plot.y_range.end = y_range_energy.end;\n        });\n    "}}]]]},"width":250,"label":"Standardize Axes Scale"}}]}}]}},{"type":"object","name":"Spacer","id":"p1935","attributes":{"width":30}},{"type":"object","name":"GridPlot","id":"p1886","attributes":{"rows":null,"cols":null,"sizing_mode":"stretch_both","toolbar":{"type":"object","name":"Toolbar","id":"p1885","attributes":{"tools":[{"type":"object","name":"ToolProxy","id":"p1877","attributes":{"tools":[{"id":"p1040"},{"id":"p1185"},{"id":"p1330"},{"id":"p1475"},{"id":"p1620"},{"id":"p1765"}]}},{"type":"object","name":"ToolProxy","id":"p1878","attributes":{"tools":[{"id":"p1041"},{"id":"p1186"},{"id":"p1331"},{"id":"p1476"},{"id":"p1621"},{"id":"p1766"}]}},{"type":"object","name":"ToolProxy","id":"p1879","attributes":{"tools":[{"id":"p1042"},{"id":"p1187"},{"id":"p1332"},{"id":"p1477"},{"id":"p1622"},{"id":"p1767"}]}},{"type":"object","name":"SaveTool","id":"p1880"},{"type":"object","name":"ToolProxy","id":"p1881","attributes":{"tools":[{"id":"p1051"},{"id":"p1196"},{"id":"p1341"},{"id":"p1486"},{"id":"p1631"},{"id":"p1776"}]}},{"type":"object","name":"ToolProxy","id":"p1882","attributes":{"tools":[{"id":"p1052"},{"id":"p1197"},{"id":"p1342"},{"id":"p1487"},{"id":"p1632"},{"id":"p1777"}]}},{"type":"object","name":"ToolProxy","i
